import React from "react";

function Code() {
  return (
    <div className="Code">
      <h1>Code Examples</h1>
      <code>
        {`html { background: red; }`}
        <br />
        {`body { color: blue; }`}
        <br />
      </code>
    </div>
  );
}

export default Code;
